pub enum Consumed<T> {

    /// Constructor indicating that the parser has consumed elements
    Consumed(T),

    /// Constructor indicating that the parser did not consume any elements
    Empty(T),
}

pub enum FastResult<T, E> {
    ConsumedOk(T),
    EmptyOk(T),
    ConsumedErr(E),
    EmptyErr(Tracked<E>),
}

pub enum Info<T, R> {
    Token(T),
    Range(R),
    Owned(String),
    Borrowed(&'static str),
}

pub enum Error<T, R> {

    /// Error indicating an unexpected token has been encountered in the stream
    Unexpected(Info<T, R>),

    /// Error indicating that the parser expected something else
    Expected(Info<T, R>),

    /// Generic message
    Message(Info<T, R>),

    /// Variant for containing other types of errors
    Other(Box<StdError + Send + Sync>),
}

pub enum TakeRange {

    /// Found the pattern at this offset
    Found(usize),

    /// Did not find the pattern but the parser can skip ahead to this offset.
    NotFound(usize),
}
